import React, { useState } from "react";
import './style.css';
import Logo from "../../assets/logo.png";
import ImageButton from '../../assets/moon.png'
import imagemButtonblack from '../../assets/sun.png'


export default function Topo(){
    
const[mudarCor,setMudarcor] = useState(false)
const alterarcor = () => {
    setMudarcor(!mudarCor)


}
    return(
        <header className={mudarCor ? "black-topo":"Topo"}>
            

       <img className="LOGO" src={ Logo } />

       <div>
        <button className={mudarCor ? 'botao-bleck':'.botao'} onClick={alterarcor}><img  className="icone" src={ mudarCor ? imagemButtonblack: ImageButton} alt="imagemdobuton"/></button>
       </div>

        </header>

    )
}
